import React from "react";
import { connect } from "react-redux";
import ProjectForm from "./ProjectForm";
import _ from "lodash";

import { getMetatData } from "../../actions";

class CreateProject extends React.Component {
  componentDidMount() {
    this.props.getMetatData();
  }

  render() {
    if (!this.props.projectdata) {
      return <div>Loading...</div>;
    }

    return (
      <div className="ui form">
        <h3 className="ui dividing header">Project Information</h3>
        <ProjectForm
          initialValues={_.pick(this.props.projectdata, "client", "employee")}
        />
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    projectdata: state.projectdata,
  };
};

export default connect(mapStateToProps, { getMetatData })(CreateProject);
